import React from 'react'
import styled from 'styled-components'
import { colors } from '../../styles/Variables'

const Container = styled.div`
  width: 100%;
  background-color: ${colors.backgroundBlack};
  color: ${colors.white};
  padding: 16px;
`


const Header = () => {
    return (
        <Container>
            <div>
                <h1>Github Viewer</h1>
            </div>
            <ul>
                <li>Issue</li>
                <li>Pull Request</li>
            </ul>

        </Container>
    );
}

export default Header
